import React from "react";
import { Link } from "react-router-dom";
import { CardContent, Grid, Card, TextField } from "@mui/material";

export const Addcategory = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={3}>
        <h2>Add Category</h2>
      </Grid>
      <Grid item xs={9}></Grid>
      <Grid item xs={12}>
        <Grid container spacing={2}>
          <Grid item xs={6}></Grid>
          <Grid item xs={2}>
            <h3>Category Nmae:-</h3>
          </Grid>
          <Grid item xs={3}>
            <TextField variant="outlined" fullWidth label="" />
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
};
